INSERT INTO `realisations` (`id`, `created`, `title`, `subtitle`, `description`, `photo`, `alt`, `priority`, `active`, `name_photo_1`, `short_desc`) VALUES (1, '2020-10-20 12:28:20', 'Title of the new article', NULL, '<h3><strong>Zasady programu dotyczące Gmaila</strong></h3>\r\n<p><br>Dzięki Zasadom programu Gmail wszyscy użytkownicy mogą bezpiecznie i przyjemnie korzystać z Gmaila. Mogą one ulec zmianie, dlatego warto co jakiś czas odwiedzać tę stronę. Więcej informacji znajdziesz w Warunkach korzystania z usług Google.<br><br></p>\r\n<p><strong>Spam i poczta masowa</strong><br>Gmaila nie wolno używać do rozsyłania spamu lub niezamawianych e-maili reklamowych.</p>\r\n<p>Gmaila nie wolno używać do wysyłania e-maili z naruszeniem ustawy CAN-SPAM lub innych przepisów antyspamowych, wysyłania niedozwolonych e-maili za pośrednictwem otwartych serwerów innych firm ani do rozpowszechniania adresów e-mail innych osób bez ich zgody.</p>\r\n<p>Nie wolno używać interfejsu Gmaila w sposób automatyczny do wysyłania, usuwania lub filtrowania e-maili w sposób wprowadzający użytkowników błąd.</p>\r\n<p>Pamiętaj, że Twoja definicja „niezamawianej” lub „niechcianej” poczty może różnić się od tego, jak rozumieją ten termin odbiorcy Twoich e-maili. Wysyłając e-maile do dużej liczby odbiorców, za każdym razem zastanów się, czy postępujesz właściwie, nawet jeśli wcześniej adresaci zgadzali się na otrzymywanie e-maili od Ciebie. Gdy użytkownicy Gmaila oznaczą wiadomości jako spam, wzrośnie prawdopodobieństwo, że wiadomości, które wyślesz w przyszłości będą klasyfikowane jako spam przez nasze systemy zwalczania nadużyć.</p>\r\n<p>Tworzenie wielu kont Gmaila i korzystanie z nich<br>Nie wolno tworzyć ani używać kolejnych kont w celu naruszania zasad Google, obchodzenia ograniczeń kont Gmaila, omijania filtrów lub naruszania w inny sposób ograniczeń nałożonych na konto. Jeśli na przykład Twoje konto Gmail zostało zablokowane przez innego użytkownika lub wyłączone z powodu naruszenia zasad, nie wolno Ci tworzyć kolejnego konta, które wykorzystasz w podobny sposób.</p>\r\n<p>Nie wolno również tworzyć kont Gmaila w sposób automatyczny, ani kupować, sprzedawać, wymieniać i odsprzedawać kont Gmaila innym osobom.<br><br></p>\r\n<p><strong>Złośliwe oprogramowanie</strong><br>Gmaila nie wolno używać do przesyłania wirusów, złośliwego oprogramowania, robaków, błędów, koni trojańskich, uszkodzonych plików lub podobnych elementów o charakterze destrukcyjnym lub wprowadzającym w błąd. Nie wolno też rozpowszechniać treści, które utrudniają lub zakłócają działanie sieci, serwerów i pozostałej infrastruktury Google lub innych firm.</p>\r\n<p>Oszustwa, wyłudzanie informacji i inne działania wprowadzające w błąd<br>Bez wyraźnej zgody innego użytkownika nie możesz korzystać z jego konta Gmail. Nie wolno używać Gmaila do oszukiwania, wprowadzania w błąd lub podszywania się pod kogoś innego, aby nakłonić innych użytkowników do udostępnienia informacji.</p>\r\n<p>Nie wolno wyłudzać danych użytkowników, takich jak dane logowania, hasła, dane finansowe czy numery dowodów tożsamości, ani posługiwać się Gmailem jako narzędziem szerzej zakrojonego planu nieuczciwych działań wobec innych osób.<br><br></p>\r\n<p><strong>Bezpieczeństwo dzieci</strong><br>Google stosuje zasadę kategorycznego braku tolerancji wobec materiałów wizualnych związanych z wykorzystywaniem seksualnym dzieci. Jeśli dowiemy się o takich materiałach, zgłosimy je odpowiednim służbom. Możemy też podjąć działania dyscyplinarne – w tym usunąć konta Gmail podejrzanych osób.<br><br></p>\r\n<p><strong>Prawa autorskie</strong><br>Należy przestrzegać praw autorskich. Zabronione jest naruszanie praw własności intelektualnej innych osób (w tym praw patentowych, praw ochrony znaków towarowych, tajemnicy handlowej i innych praw własności) oraz zachęcanie lub prowokowanie do ich naruszania. Naruszenie praw autorskich można zgłaszać Google za pomocą tego formularza.<br><br></p>\r\n<p><strong>Nękanie</strong><br>Gmaila nie wolno używać do nękania innych osób, zastraszenia ich ani grożenia im. Każdemu, kto dopuści się używania Gmaila do takich celów, grozi wyłączenie konta.<br><br></p>\r\n<p><strong>Działania niezgodne z prawem</strong><br>Należy przestrzegać prawa. Nie wolno używać Gmaila do działań naruszających prawo.</p>', '2020-10-20/img_(27).jpg', 'photo', 4, '1', NULL, 'Tworzenie wielu kont Gmaila i korzystanie z nich<br>Nie wolno tworzyć ani używać kolejnych kont w celu naruszania zasad Google, obchodzenia ograniczeń kont Gmaila, omijania filtrów lub naruszania w inny sposób ograniczeń nałożonych na konto. Jeśli na przykład Twoje konto Gmail zostało zablokowane przez innego użytkownika lub wyłączone z powodu naruszenia zasad, nie wolno Ci tworzyć kolejnego konta, które wykorzystasz w podobny sposób.');
